tables.table_schema:
CREATE TABLE ChargingStations (
    station_id INT PRIMARY KEY,
    station_name VARCHAR(50) NOT NULL,
    location VARCHAR(100) NOT NULL,
    charging_capacity INT
);

CREATE TABLE ElectricVehicles (
    vehicle_id INT PRIMARY KEY,
    brand_name VARCHAR(255),
    model_name VARCHAR(255),
    battery_capacity FLOAT
);

CREATE TABLE ChargingStations (
    station_id INT PRIMARY KEY,
    location VARCHAR(255),
    num_charging_points INT,
    station_power_rating FLOAT
);

CREATE TABLE ChargingEvents (
    event_id INT PRIMARY KEY,
    timestamp TIMESTAMP,
    vehicle_id INT,
    station_id INT
);

CREATE TABLE EnergyConsumption (
    consumption_id INT PRIMARY KEY,
    event_id INT,
    energy_consumed FLOAT,
    charging_duration INT
);

CREATE TABLE electric_vehicles (
    vehicle_id INT PRIMARY KEY,
    model_name VARCHAR(50),
    battery_capacity DECIMAL(10,2),
    charging_station_id INT
);

CREATE TABLE charging_stations (
    station_id INT PRIMARY KEY,
    location_name VARCHAR(100),
    available_chargers INT,
    operating_hours VARCHAR(50)
);

CREATE TABLE energy_consumption (
    consumption_id INT PRIMARY KEY,
    vehicle_id INT,
    date_time TIMESTAMP,
    energy_used DECIMAL(10,2)
);

CREATE TABLE users (
    user_id INT PRIMARY KEY,
    name VARCHAR(50),
    email VARCHAR(100),
    registration_date DATE
);
